import React, {useState, useEffect} from 'react';
import classes from '../../CSS/Main.module.css'
import padContext from '../Context/Pad-context';

const Solve =(props) =>{
    return(
        <div className={classes.PageBtns}>
            <padContext.Consumer>
                {(context)=>
            <button onClick={context.triggerTimer} className={classes.Solvebtn}>{props.children}</button>
                }   
        </padContext.Consumer>
        </div>
    )
}
export default Solve;
